import React, { Component } from "react";
import { HistoryItems } from "./HistoryItems";

export class UserProfile extends Component {
  render() {
    return (
      <div>
        <img src="./test.jpg" alt="profile" />
        <h1>Name</h1>
        <button>Edit</button>
        <h2>Description...</h2>
        <h2>Rating</h2>
        <ul></ul>
      </div>
    );
  }
}

export default UserProfile;
